import React, { Component } from 'react'
import './ImgSlideBar.css'

export default class ImgSlideBar extends Component {

    render() {

        const img = [
            {
                id:1,
                imag: <img src="https://static.bangkokpost.com/media/content/dcx/2020/02/07/3517079.jpg"  alt="" />
            },
            {
                id:2,
                imag: <img src="https://cf.bstatic.com/images/hotel/max1280x900/991/9918189.jpg"  alt="" />
            },
            {
                id:3,
                imag: <img src="https://media-cdn.tripadvisor.com/media/photo-s/0e/65/a7/24/best-western-premier.jpg"  alt="" />
            }
        ];

        let img2 =[]
        for (let i = 0; i < img.length; i++){
            img2.push("Img "+img[i].imag)
        }



        return (
            <div className="imgslide">
                <img2 />
            </div>
        )
    }
}
